import React from 'react'
import { Link } from 'react-router-dom'

const Footer = () => {
  return (
    <footer>
      <p style = {{ "fontSize": "18px" }}>Deon Mai 2021 | <Link to = "/about">Settings</Link></p>
    </footer>
  );
}

export default Footer
